import React from 'react';
import axios from 'axios';

function App() {
  const handleGetPlayers = () => {
    axios.get('http://localhost:3000/players')
      .then(response => {
        console.log(response.data);
      })
      .catch(error => {
        console.log(error);
      });
  }

  return (
    <div className="App">
      <button onClick={handleGetPlayers}>Get All Players</button>
    </div>
  );
}

export default App;
